@Test
  public void where_returnsNotNullValue() {
    /* Given */
    DeleteFromImpl deleteFrom = new DeleteFromImpl(null, "table", mock(SqlPart.class));

    /* When */
    DeleteWhere result = deleteFrom.where("a=?", 1);

    /* Then */
    assertThat(result, is(notNullValue()));
  }

